import React from "react";
import { Route, BrowserRouter, Switch, Link, Redirect } from "react-router-dom";
import SlideShow from "../home files/slideshow";
import "./Home.css";
import Home from "../Home";
import MenCard from "../options/menCard";

class MainPage extends React.Component {
  constructor(props) {
    super(props);
  }

  render() {
    return (
      <>
        <header className="deskstop-container">
          <nav className="navb">
            <div
              className="options_Login"
              style={{
                display: "flex",
                justifyContent: "space-between",
              }}
            >
              <div className="navbar-bran">
                <span className="super" style={{}}>
                  <h2>Super Stylist</h2>
                </span>
              </div>
              <div
                style={{
                  display: "flex",
                  flexDirection: "row-reverse",
                  justifyContent: "center",
                  alignItems: "center",
                }}
              >
                <Link className="profil" to="/profile">
                  <div>
                    <i className="fas fa-user"></i>
                  </div>
                </Link>
                <Link className="Logi" to="/login">
                  <h4>Login/SignUp</h4>
                </Link>

                <Link className="Abou" to="/About">
                  <h4>About Us</h4>
                </Link>
                <Link className="Contac" to="/Contact">
                  <h4>Contact</h4>
                </Link>
              </div>
            </div>
          </nav>
        </header>

        <div className="options" style={{ display: "flex" }}>
          <div>
            <Link
              className="Men"
              to="/Men"
              onMouseOver={this.props.handleMouseHoverMen}
              onMouseLeave={this.props.handleMouseHoverMen}
            >
              Men
            </Link>

            <Link
              className="Women"
              to="/Women"
              onMouseOver={this.props.handleMouseHoverWomen}
              onMouseLeave={this.props.handleMouseHoverWomen}
            >
              Women
            </Link>
            <Link className="LookBook" to="/LookBook">
              LookBook
            </Link>
            <Link className="FashionTips" to="/FashionTips">
              FashionTips
            </Link>
          </div>
          <div style={{ marginRight: "10px" }}>
            <Link className="Home" to="/">
              Home
            </Link>
          </div>
        </div>
      </>
    );
  }
}
export default MainPage;
